import { useState } from "react";

function Header() {
  return (
    <div className="header-wrapper">
      <h1>Budget</h1>
      <div className="header-links">
        <a href="./UploadBalances">Upload balances</a>&nbsp;&nbsp;
        <a href="./reports">Reports</a>
      </div>{" "}
    </div>
  );
}

function Footer() {
  return (
    <div className="footer-wrapper">
      <h1>Footer</h1>
    </div>
  );
}

function Items() {
  const [data, setData] = useState(account);

  return data.map((item, index) => {
    return (
      <Item
        id={item.id}
        title={item.title}
        currentBalance={item.current}
        budgetBalance={item.budget}
        arrayIndex={index}
        setData={setData}
      />
    );
  });
}

function Item({
  id,
  title,
  currentBalance,
  budgetBalance,
  arrayIndex,
  setData,
}) {
  const [edit, setEdit] = useState(false);
  let titleField = title;
  let budgetBalanceField = budgetBalance;

  let width = (currentBalance / budgetBalance) * 100;
  if (width > 99) width = 100;

  const saveEdit = (event) => {
    let localAccount = account.slice();
    localAccount[arrayIndex].title = document.getElementById(
      `${id}TitleEdit`
    ).value;
    localAccount[arrayIndex].budget = Number(
      document.getElementById(`${id}BudgetEdit`).value
    );
    console.log(localAccount);
    setData(localAccount);
    setEdit(false);
    event.preventDefault();
  };

  if (edit) {
    titleField = (
      <>
        <input
          type="text"
          id={id + "TitleEdit"}
          key={id + "TitleEdit"}
          defaultValue={title}
          size="30"
        />
        <button
          type="submit"
          id={id + "TitleSave"}
          key={id + "TitleSave"}
          onClick={(event) => saveEdit(event)}
        >
          save
        </button>
      </>
    );
    budgetBalanceField = (
      <input
        type="number"
        id={id + "BudgetEdit"}
        key={id + "BudgetEdit"}
        defaultValue={budgetBalance}
        style={{ width: "70px" }}
      />
    );
  } else {
    titleField = title;
    budgetBalanceField = currentBalance + " of " + budgetBalance;
  }

  const handleEditClick = (event) => {
    if (edit) setEdit(false);
    else setEdit(true);
    event.preventDefault();
  };

  return (
    <>
      <div
        id={id + "WrapperDiv"}
        key={id + "WrapperDiv"}
        className="title-wrapper"
      >
        <div id={id + "Title"} key={id + "Title"} className="item-title">
          <i className="bi bi-trash"></i> &nbsp;
          <button
            key={id + "EditLink"}
            className="edit-button"
            onClick={(event) => handleEditClick(event)}
          >
            <i className="bi bi-pencil-square"></i>
          </button>
          &nbsp;
          {titleField}
        </div>
        <div id={id + "Balance"} key={id + "Balance"} className="item-balance">
          {budgetBalanceField}
        </div>
      </div>
      <div className="bar-wrapper">
        <div
          id={id + "BarCurrent"}
          key={id + "BarCurrent"}
          style={{ width: width + "%" }}
          className="item-current"
        ></div>
        <div
          id={id + "BarBudget"}
          key={id + "BarBudget"}
          style={{ width: 100 - width + "%" }}
          className="item-budget"
        ></div>
      </div>
    </>
  );
}

function Budget() {
  return (
    <div>
      <Header key="1" />
      <Items key="2" />
      <Footer key="3" />
    </div>
  );
}

const account = [
  { id: 1, current: 150, budget: 300, title: "Auto" },
  { id: 2, current: 1500, budget: 1500, title: "Home loan" },
  { id: 3, current: 750, budget: 1000, title: "Groceries" },
  { id: 4, current: 250, budget: 300, title: "Travel" },
  { id: 5, current: 500, budget: 400, title: "Misc" },
];

export default function App() {
  return <Budget />;
}
